import React, { useEffect, useState } from 'react'
import Header from "../components/Header";
import Footer from '../components/Footer';
import { Formik, Form, Field, FieldArray, ErrorMessage } from 'formik';
import * as yup from 'yup';
import axios from 'axios';
import { Await, Link, useNavigate } from 'react-router-dom';


const UploadDocuments = () => {
    const [username, setUsername] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        const axiosConfig = {
            headers: {
                'Accept': 'application/json',
                Authorization: 'Bearer ' + localStorage.getItem("token"),
            }
        }
        axios
            .get('https://rsacarbook.jaraware.com/api/v1/getUserData', axiosConfig)
            .then((res) => {
                setUsername(res.data.data.user.first_name);
            })
            .catch((err) => {
                console.log(err);
            });
    }, []);
    const removeToken = (userToken) => { // export function from module 
        localStorage.removeItem("token");
        navigate("/");
    }

    const [file, setFile] = useState('');
    const [file2, setFile2] = useState('')
    const [file3, setFile3] = useState('')
    const [file4, setFile4] = useState('')

    function handleChange(event) {
        setFile(event.target.files[0])
    }
    function handleChange2(event) {
        setFile2(event.target.files[0])
    }
    function handleChange3(event) {
        setFile3(event.target.files[0])
    }
    function handleChange4(event) {
        setFile4(event.target.files[0])
    }


    function handleSubmit(event) {
        event.preventDefault()
        const url = 'https://rsacarbook.jaraware.com/api/v1/uploadUserDocument';
        const formData = new FormData();

        formData.append('aadhar_front', file);
        formData.append('aadhar_back', file2);
        formData.append('license', file3);
        formData.append('license_back', file4);
        console.log(file); console.log(file2); console.log(file3); console.log(file4);
        //formData.append('fileName', file.name);

        const config = {
            headers: {
                // 'content-type': 'multipart/form-data',
                Authorization: 'Bearer ' + localStorage.getItem("token"),
            },
        };
        axios.post(url, formData, config).then((response) => {
            console.log(response.data);
        });

    }

    const proPic = localStorage.getItem("profilepic");
    const uname = localStorage.getItem("first_name");


    return (
        <>
            <header className='dash-header'>
                <div className='app-logo'>
                    <h1><Link to="/dashboard">Prakash</Link></h1>
                </div>
                <div className='app-right'>
                    <p>Hi, <span className='white-color'>{uname}</span>
                        <img className='pro-pic' alt="pro" src={proPic} />
                        <button class="custom-btn" onClick={removeToken}>Log Out</button>
                    </p>
                </div>
            </header>
            <section className='signup-page dashboard'>
                <div className='d-flex'>
                    <div className='sign-left'>
                        <ul className='user-pages'>
                            <li><Link className='custom-btn' to='/updateprofile'>Update Your Profile</Link> </li>
                            <li><Link className='custom-btn' to='/uplaodDocument'>Upload Your Documents</Link> </li>
                            <li><Link className='custom-btn' to='/inquery'>Inquery</Link> </li>
                            <li><Link className='custom-btn' to='/pricing'>Pricing</Link> </li>
                            <li><button className="custom-btn" onClick={removeToken}>Log Out</button></li>
                        </ul>
                    </div>
                    <div className='sign-right'>
                        <div className='main-form'>
                            <h2>Update Your Profile Details :</h2>
                            <label>Photo :</label>
                            {/* <input 
                    type="file"
                    name='aadhar_front'
                    onChange={handlechange}
                    />

                    <button className='custom-btn' onClick={handleAPI}>submit</button> */}
                            <form onSubmit={handleSubmit}>
                                <h1>React File Upload</h1>
                                <input type="file" name='aadhar_front' onChange={handleChange} />
                                <input type="file" name='aadhar_back' onChange={handleChange2} />
                                <input type="file" name='license' onChange={handleChange3} />
                                <input type="file" name='license_back' onChange={handleChange4} />
                                <button type="submit">Upload</button>
                            </form>


                            {/* <Formik 
                    // onSubmit={handleSubmit}
                    >
                        <Form>
                            {/* <div className='form-group'>
                                <label>Enter Your license:</label>
                                <Field 
                                type="file"
                                name="license"
                                onChange={handleFileSelect}
                                placeholder="Enter Your license"
                                />
                                <p className='error-msg'>
                                    <ErrorMessage name='license' />
                                </p>
                            </div>
                            <div className='form-group'>
                                <label>Enter Your license_back:</label>
                                <Field 
                                type="file"
                                name="license_back"
                                onChange={handleFileSelect}
                                placeholder="Enter Your license_back"
                                />
                                <p className='error-msg'>
                                    <ErrorMessage name='license_back' />
                                </p>
                            </div>
                            <div className='form-group'>
                                <label>Enter Your aadhar_front:</label>
                                <Field 
                                type="file"
                                name="aadhar_front"
                                onChange={handleFileSelect}
                                placeholder="Enter Your aadhar_front"
                                />
                                <p className='error-msg'>
                                    <ErrorMessage name='aadhar_front' />
                                </p>
                            </div>
                            <div className='form-group'>
                                <label>Enter Your aadhar_back</label>
                                <Field 
                                type="file"
                                name="aadhar_back"
                                onChange={handleFileSelect}
                                placeholder="Enter Your aadhar_back"
                                />
                                <p className='error-msg'>
                                    <ErrorMessage name='aadhar_back' />
                                </p>
                            </div> */}
                            {/* <div className='submit-btn form-group'>
                                <button 
                                className='custom-btn' 
                                type='submit' value="Upload File">Upadte Profile</button>
                            </div> */}
                            {/* <div className='form-group back-success'>
                                {success}
                            </div>
                            <div className='form-group back-error'>
                                {error}
                            </div> */}
                            {/* </Form>
                    </Formik> }
                    */}
                        </div>
                    </div>
                </div>
                <Footer />

            </section>
        </>
    )
}

export default UploadDocuments;
